import axinos from 'axios';

const url = 'https://covid19.mathdro.id/api'


const fetchData = async ()=>{
    // try{
    const response = await axinos.get(url);
    const confirmed = response.data.confirmed;
    const recovered = response.data.recovered;
    const deaths = response.data.deaths;
    const lastUpdate = response.data.lastUpdate;
    const modified_response = {
        'confirmed': confirmed,
        'recovered': recovered,
        'deaths': deaths,
        'lastUpdate': lastUpdate 
    }
    // console.log('the people comfired that got cronovirus: ' + confirmed);
    // } catch{
    //     console.log("err");
    // }
    return modified_response
}

export default fetchData();
